import React from "react";
import CardItem from "./CardItem";
const Cards = () =>{
    return(
        <div className='cards'>
            <div className='cards-container'>
                <div className='cards-wrapper'>
                    <CardItem title="Scheduler" description="picture of the scheduler" photosrc="../../assests/projectImages/calendarGUI.png">
                        This project is for the Emergency Department of the Lincoln Medical Center </CardItem>
                    <CardItem title="The London Eye" description="picture of the london eye" photosrc="../../assests/projectImages/eyeOfLondon.JPG">
                        Picture from Photography Portfolio: The London Eye </CardItem>
                </div>

            </div>
        </div>
    );
}

export default Cards;
